import React from "react";

const Calculator = () => {
  const [calculate, setcalculate] = useState([]);

  const ambilangka = () => {
    let angka = [];

    for (let i = 0; i < 10; i++) {
      angka.push(<button key={i}>{i}</button>);
    }
    console.log(angka);
  };

  return (
    <div>
      <div className="container">
        <div className="display">
          <div>
            <span>(0)</span>0
          </div>
          <div className="buttonatas">
            <button>/</button>
            <button>X</button>
            <button>-</button>
            <button>+</button>
            <button>DEL</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Calculator;
